import { ActualTrainingDetail } from "app/claim/model/actual-training-detail.model";
import { Claim, ClaimItem, ClaimSuppDoc } from "../../model/claim.model";
import { ClaimItemDetail } from "./ClaimItemDetail.model";
import { EmpClaim, EmpClaimHardcopy } from './EmpClaim.model';

export class EmpClaimRequest {

    saveEmpClaimRequestDto: SaveEmpClaimRequest; 

    action: string;
    claimInboxId: string;
    claimDto: Claim;
    claimSuppDocList: ClaimSuppDoc[];
    claimItemList: ClaimItem[];
    empClaimDto: EmpClaim;
    empClaimHardcopyDto: EmpClaimHardcopy;
    cpfSnapshotList: CpfSnapshot[];

    // NSManinfo
    nsManName: string;
    nsManRank: string;
    nsManPhoneNum: string;
    nsManTOS: string;
    nsManGender: string;

    // Company
    coyName: string;
    coyType: string; // codetype
    claimOption: string;
    coyAddress: string;
    coyDirectInd: string;
    coySize: number;

    // Others
    restDay: string[];
    remarks: string;
    cab: string;
    closedRemarks: string;
    recompRemarks: string;

    // Frontend uses
    isDummyCoy: boolean;
    csn1: string;
    csn2: string;
    csn3: string;

    responseMsg: string;
    claimInboxReason: string;

    itemDetailList: ClaimItemDetail[];

    actualTrainingDetailsList: ActualTrainingDetail[];
}

export class CpfSnapshot {
    cpfSnapshotId: string;
    nric: string;
    csn: string;
    startYearMonth: string;
    endYearMonth: string;
    prepopulatedInd: string;
    latestContributionYearMonth: string;
    cpfSnapDate: string;
    cpfSnapshotInfoDtoList: CpfSnapshotInfo[];
    createdBy: string;
    createdDt: Date;
    updatedBy: string;
    updatedDt: Date;
    createdByInit: string;
}

export class CpfSnapshotInfo {
    cpfSnapshotInfoId: string;
    owAmount: number;
    awAmount: number;
    relevantContributionYearMonth: string;
    cpfSnapDate: string;
    latestContributionYearMonth: string;
}

export class SaveEmpClaimRequest {
    saveClaimInd: string;
    saveEmpClaimInd: string;
    saveClaimItemInd: string;
    saveEmpClaimItemInd: string;
    saveEmpClaimItemStatusInd: string; //EmpClaimHardcopy
    saveSupportingDocumentInd: string;
    saveClaimInboxInd: string;
    saveCpfSnapshotInd: string;
    saveRemarksInd: string;
    saveRestDayInd: string;
    saveActualTrainingSectionInd: string;
    saveCompanyOfficerInd: string;
    saveCompanyAddressInd: string;
}
